import React, { Component } from 'react';
import '../styles/homepage.scss';

class Homepage extends Component {
  constructor() {
    super();
    this.state = {
      url: null
    };
  }

  Simplify () {
    console.log("Simplify");
  }

  render() {
    return (
      <div className="homepage">
        <div className="homepage__container">
          <div className="homepage__container__logo">
            <h1 className="homepage__container__logo__texts">
              <span className="homepage__container__logo__texts--small">Simplify</span>
              <span className="homepage__container__logo__texts--bigger">Journal</span>
            </h1>
          </div>
          <div className="homepage__container__actions">
            <div className="homepage__container__actions__input">
              <input onChange={(value) => console.log(value)} className="homepage__container__actions__input--input" placeholder="Enter article to simplify" />
              <button className="homepage__container__actions__input--clear">X</button>
            </div>
            <button onClick={() => this.Simplify()} className="homepage__container__actions--button">SIMPLIFY</button>
            <a className="homepage__container__actions--example" 
            href="/https://oglobo.globo.com/brasil/apos-ir-protesto-com-criticas-ao-stf-bolsonaro-diz-que-estara-onde-povo-estiver-1-24455623"
            >See an example</a>
          </div>
        </div>
      </div>
    );
  }
}

export default Homepage;
